-- Connect as a superuser (e.g., 'postgres') initially to create users and databases.
-- You would typically run this from a tool like `psql` or `pgAdmin` after connecting as a superuser.

-- 1. Create the 'main' user with a password
-- 'SUPERUSER' grants broad permissions. For production, consider more granular roles.
CREATE USER "main" WITH PASSWORD 'main' SUPERUSER;

-- 2. Create the 'minimal-user' with a password
-- This user is intended for read-only access on specific tables.
CREATE USER "minimal-user" WITH PASSWORD 'minimal';

-- 3. Create the 'london-db' database
-- Specify the owner of the new database.
CREATE DATABASE "london-db" OWNER "main";

-- 4. Grant privileges on the database to the 'main' user
-- The 'main' user is already the owner, so this is mostly redundant but harmless.
-- CONNECT privilege is implied by ownership.
GRANT ALL PRIVILEGES ON DATABASE "london-db" TO "main";

-- 5. Connect to the 'london-db' database
-- This command is for psql. In a script, you'd typically connect to the specific DB.
-- For a script, you would run subsequent commands using the 'main' user connected to 'london-db'.
\c london-db;

-- Now, ensure you are connected as the 'main' user to 'london-db' for the following commands.

-- 6. Enable the pgvector extension
-- This must be done per database where you want to use the VECTOR type.
CREATE EXTENSION IF NOT EXISTS vector;

-- 7. Create the 'locations' table
CREATE TABLE IF NOT EXISTS locations (
    sight_id VARCHAR(50) PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    category VARCHAR(100),
    description TEXT,
    embedding VECTOR(768)
);

-- 8. Create an HNSW index on the 'locations' table for efficient similarity search
-- 'vector_cosine_ops' is for cosine similarity.
CREATE INDEX ON locations USING hnsw (embedding vector_cosine_ops);

-- 9. Create the 'activities' table
-- Note: 'activities' schema has 'embedding VECTOR(788)' which is different from '768' for locations.
-- Please ensure this dimension is intentional and matches your embedding model for activities.
CREATE TABLE IF NOT EXISTS activities (
    activity_id VARCHAR(50) PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    duration_min INT,
    duration_max INT,
    kid_friendliness_score INT,
    cost INT,
    sight_id VARCHAR(50) REFERENCES locations(sight_id), -- Foreign key to locations table
    description TEXT,
    embedding VECTOR(768)
);

-- 10. Create an HNSW index on the 'activities' table for efficient similarity search
CREATE INDEX ON activities USING hnsw (embedding vector_cosine_ops);

-- 11. Grant SELECT privileges to 'minimal-user'
-- This allows 'minimal-user' to read data from these tables.
GRANT SELECT ON locations TO "minimal-user";
GRANT SELECT ON activities TO "minimal-user";

